public void testEmptyMapField(){ClassWithMap obj=new ClassWithMap();obj.map=new LinkedHashMap<String,Integer>();String json=gson.toJson(obj);assertTrue(json.contains("{
  "map": {},
  "value": 2
}"));}

public void testHelloWorld()throws IOException {String json="{
" + "   "hello": true,
" + "   "foo": ["world"]
"+ "}";JsonReader reader=new JsonReader(new StringReader(json));reader.beginObject();assertEquals("hello",reader.nextName());assertEquals(true,reader.nextBoolean());assertEquals("foo",reader.nextName());reader.beginArray();assertEquals("world",reader.nextString());reader.endArray();reader.endObject();assertEquals(JsonToken.END_DOCUMENT,reader.peek());}
